let mklb first ~loc (p, e) attrs =
  let open Location in {
    lb_pattern = p;
    lb_expression = e;
    lb_attributes = attrs;
    lb_docs = symbol_docs_lazy loc.loc_start loc.loc_end;
    lb_text = (if first then empty_text_lazy
               else symbol_text_lazy loc.loc_start);
    lb_loc = loc;
  }
